window.bookSummaryJSON = "<p>VP Securities. We own this city. As the leader in technological advancements for private and commercial security, we are always in the know, but when our cutting-edge facial recognition software gets stolen, it threatens not only our livelihood but jeopardizes our species as a whole.</p> <p><b>Cain</b><br> The only problem with finding your mate is when you realize that she has no idea this world exists or that you are spending time with her to keep secrets for your pack. I am put on guard duty to ensure not only her safety but her silence. It doesn’t take long to realize I can’t resist the pull I feel toward her. Can I keep her safe if she keeps me at a distance? How do I convince her that her fate lies with me?</p> <p><b>Bri</b><br> All I want out of my senior year of college is to coast through my final classes and get the heck out of this city, but when I witness a crime I never should have seen, the time can’t go fast enough. As I try to keep my head down, Cain crashes into my life, making me feel things I thought I had turned off years ago. I find myself lost in his stormy grey eyes as I try to fight my way out of trouble, out of this city, and out of his web. All I can hope is to leave with my life and heart intact.<br> <br> Stolen AI, murder, treason, and an impending war with a bunch of supernatural bad guys push this love story on a path of no return. Will Bri and Cain overcome these odds to find a way to be together? Or will the secrets piling up prevent them from their happily ever after?</p>"; 
